import React from 'react';
import "./aside.css"

import Background from '../images/background_image.png';


const Aside = (props) => (
    <aside>
        <div className="avatarContainer">
            <div className="avatarImagem" style={ sectionStyle } >
            </div>
        </div>
    </aside>
);

var sectionStyle = {
    width: "100%",
    height: "400px",
    backgroundImage: "url(" + { Background } + ")"
};    


export default Aside;
